import { Data } from "./Data"
import React from 'react';
import { Subgrid, SuperSubgrid } from "./Counteranimation.element";
function Component() {
    return (
        <>
        

            {Data.map((item,index)=>{
        return(  
        <>
            <Subgrid>
            <div>whaty</div>
            </Subgrid>
        
        <SuperSubgrid>
                    <div>{item.state}</div>
                    <div>{item.customer}</div>
                    <div>{item.description}</div>
            </SuperSubgrid></>)
            })}
        </>
    )
}

export default Component
